class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        # print(s)
        max = 1
        for i in range(0, len(s)):
            # print(f"i = '{i}'")
            # current_sub = ""
            for j in range(i + 1, len(s)):
                # print(f"current_sub = '{current_sub}'")
                # print(f"i = '{i}' - j = '{j}'")
                # print(f"s[j] = '{s[j]}'")
                # print(f"s[i:j] = '{s[i:j]}'")
                if (s[i:j].find(s[j]) == -1):
                    # current_sub += s[j]
                    if (j - i + 1 > max):
                        max = j - i + 1
                else:
                    break
                #     current_sub = ""
                # print(f"max = '{max}'")
        if s == "":
            max = 0
        return max


